import PropTypes from "prop-types";

const Button = ({ color, text }) => {
  return (
    <button style={{ backgroundColor: color }} className="btn">
      {text}
    </button>
  );
};

Button.defaultProps = {
  color: "steelblue",
  text: "wrong",
};

Button.propTypes = {
  color: PropTypes.string,
  text: PropTypes.string.isRequired,
};
export default Button;
